[LV]

Lietotne ir pieejama tikai Balticom interaktīvās televīzijas lietotājiem.

Balticom iTV – jauna, interaktīva televīzija, kura darbojas kā tiešsaistes kinoteātris. Jums vairs nav jāpielāgojas TV programmai – varat pārlūkot milzīgu filmu un pārraižu kartotēku un paši izlemt, ko skatīties. 

Ir, ko redzēt:
- 120 TV kanāli (vairāk nekā 70 HD / UHD)
- TV kanālu arhīvs par 7 dienām. Katalogs, kas pastāvīgi atjaunojas, daudz filmu un pārraižu.

Ērta skatīšanās:
- Ja pārtraucāt skatīties – turpiniet no tās pašas vietas jebkurā ierīcē;
- Ātra piekļuve biežāk skatītajiem kanāliem, pārraidēm, seriāliem;
- Katrā profilā sava “Izlase”, sava skatīšanās vēsture.

Citi iemesli, lai lejuplādētu Balticom iTV?
- Uzskatāma pārtīšana ar stopkadriem;
- Iespēja brīvi izvēlēties subtitru valodu un skaņu;
- Satura šķirošana pēc žanriem un kategorijām;
- Iespēja kontrolēt bērnu izvēles;
- Iespēja meklēt visā arhīvā. 


[RU] 

Приложение доступно только для пользователей интерактивного телевидения Balticom.

Balticom iTV – новое интерактивное телевидение, организованное как онлайн-кинотеатр. Больше не нужно подстраиваться под телепрограмму – листайте огромную картотеку фильмов и передач и сами решайте, что смотреть. Установка занимает всего несколько минут.

Есть, что посмотреть:
- 120 ТВ-каналов (более 70 HD/UHD)
- Архив ТВ-каналов за 7 дней. Постоянно обновляющийся каталог, множество фильмов и передач.

Удобный просмотр:
- Прервали просмотр – продолжайте с того же места на любом устройстве;
- Быстрый доступ к часто просматриваемым каналам, передачам, сериалам;
- В каждом профиле – своё “Избранное”, своя история просмотров.

Почему еще нужно скачать Balticom iTV?
- Наглядная перемотка со стоп-кадрами;
- Свободный выбор языка субтитров и озвучания;
- Сортировка контента по жанрам и категориям;
- Родительский контроль;
- Поиск по всему архиву.


[EN]

Application is only available to Balticom interactive television clients.    

Balticom iTV – new interactive television organized as an online-cinema. Flip through the wide range of programs and films to decide what to watch. Stream live television or catch up on all your favourite shows. 

What to watch:
- 120 TV channels (more than 70 HD / UHD)
- TV channel archive for 7 days. A constantly updated catalogue, plenty of movies and shows.

Useful features:
- Interrupted browsing - continue from the same place on any device;
