- Each profile has its own “Favourites” and browsing history.

Why else do You need to download Balticom iTV?
- Simple rewind with freeze-frames;
- Choose different language for subtitles and sound;
- Sort content by genre and category;
- Parental control;
- Search through the entire archive.
